      "codigo" : 1567, "aumentaria" : "Autêntica colaboração pelo bem comum, delegar tarefas chave às pessoas competentesProfissionais Liberais valorizam a proficiência em áreas especializadas. Impulsionado pelo desejo de ser  bom em algo , eles monitoram suas próprias performances profissionais. Ainda que o objetivo seja ser  o  especialista na área, Profissionais Liberais dão a impressão de que sabem algo de muitas coisas. Essa imagem é especialmente forte quando eles verbalizam o conhecimento que possuem sobre vários temas.Como Profissionais Liberais interagem com outros, frequentemente externam um estilo de estar à vontade, diplomático e de bem com a vida. Essa atitude simpática pode mudar rapidamente no ambiente de trabalho quando eles ficam concentrados em atingir altos padrões de desempenho. Valorizando a autodisciplina, Profissionais Liberais avaliam os outros pela sua autodisciplina medida no desempenho do dia a dia. Eles tem altas expectativas deles mesmos e de outros e tendem a verbalizar sua decepção.Ao mesmo tempo em que tendem a se concentrar no desenvolvimento de uma abordagem organizada para o trabalho e aumentar suas habilidades, os Profissionais Liberais também precisam ajudar os outros a desenvolver habilidades. Além disso, eles precisam aumentar seu reconhecimento àqueles que se esforçam em trabalhar ainda que eles possam não se utilizar o que os Profissionais Liberais chamam de  jeito certo ."
  });

      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 1571, "aumentaria" : "Os Agentes estão atentos tanto ao aspecto humano quanto aos aspectos da tarefa numa situação de trabalho. Com empatia e apoio, eles são bons ouvidores e são conhecidos por seus ouvidos condescendentes. Agentes também fazem com as pessoas se sintam bem quistas e necessárias por causa de sua sensibilidade às necessidades dos outros. As pessoas têm pouco medo de serem rejeitadas por Agentes. Além disso, Agentes oferecem amizade e são sensíveis a fazerem serviços pelos outros.Referente ao aspecto de tarefa do trabalho, os Agentes têm um excelente potencial para organizar um trabalho e leva-lo ao término eficientemente. Agentes são particularmente bons em fazer trabalhos para os outros que eles acham difíceis de fazer por eles mesmos. Agentes normalmente promovem a harmonia e o trabalho em grupo.No entanto, os Agentes realmente temem o conflito e a discórdia. Sua abordagem de apoio pode fazer com que os outros tolerem uma situação mais do que se comprometam a solucionar ativamente um problema. Ademais, a tendência de os Agentes não chamarem a atenção ao invés de dar-se a confrontos abertamente com pessoas agressivas, pode ser interpretada como falta de tenacidade. Ainda assim, Agentes têm um preciso grau de independência ainda que estejam preocupados em como podem encaixar-se no grupo."
  });

