      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 2611, "aumentaria" : "Controle do tempo, objetividade, senso de urgência, controle emocional, acompanhamento do que prometeu, das tarefasOs Patrocinadores têm uma extensa lista de contatos que possibilita uma base ativa para fazer negócios. Gregário e socialmente experiente, eles fazem amizades facilmente. Raramente hostilizam alguém intencionalmente. Patrocinadores buscam ambientes sociais favoráveis onde eles possam continuar a fazer e manter seus contatos. Com habilidades de oratória, são bons em promover suas próprias ideias e em criar o entusiasmo  pelos projetos de outros. Com seu grande leque de contatos, Patrocinadores têm acesso às pessoas certas que têm a capacidade de ajudar.Uma vez que Patrocinadores preferem interagir com outros e participar de atividades envolvendo pessoas, eles podem estar menos interessados em terminar as tarefas. Podem continuar buscar qualquer situação envolvendo encontro e socialização com pessoas ainda que seu trabalho exija atenção a atividades mais individuais. Eles têm sucesso em reuniões, convenções e conferências. Normalmente otimistas Patrocinadores tendem a superestimar as habilidades dos outros. Frequentemente se precipitam a conclusões favoráveis sem considerar todos os fatos. Treinamento e orientação ajudam Patrocinadores desenvolver objetividade e ênfase nos resultados. Planejamento e controle do tempo podem apresentar desafios para os Patrocinadores. Ao estabelecerem um limite de tempo em conversas, eles podem lembrar-se da urgência de  terminar  e cumprir a tarefa."
  });

