      "codigo" : 2625, "aumentaria" : "Finalização individual, empatia ao demonstrar desaprovação,  acompanhar os outros Avaliadores têm idéias criativas e fazem com que elas sirvam a um propósito prático. São competitivos e usam métodos diretos para atingir resultados. Entretanto, há os que tendem a ver os Avaliadores mais como assertivos do que como agressivos por causa de sua demonstração de consideração. Ao invés de dar ordens ou comandos, os Avaliadores comprometem pessoas nas tarefas utilizando métodos persuasivos. Eles induzem os que o cercam a cooperar por explicar a análise racional ou atividades propostas. Avaliadores tendem a ter a habilidade de ajudar os outros a visualizar os passos necessários para atingir seus resultados. Eles normalmente estão falando de um plano detalhado de ação que desenvolveram para ter certeza do progresso ordenado em direção aos resultados. No entanto, na ansiedade de vencer, os Avaliadores podem ficar impacientes quando seus padrões não forem mantidos ou quando uma finalização mais extensa for necessária.Avaliadores são bons críticos e podem ser verborrágicos ao expressar suas críticas. Suas palavras podem ser dolorosas como uma picada. Avaliadores podem ter controle melhor de problemas se ficarem tranquilos e andarem em seus ritmos. Há um axioma útil para isto:  algo você ganha e algo você perde ."
  });

