      "codigo" : 2754, "aumentaria" : "Atenção às prazos finais, iniciativa de fazer a tarefaConsultores são particularmente bons em resolver problemas pessoais. Impressionam os demais com sua maneira amável, empatia e compreensão. Acham fácil olhar o que de bom existe nos outros e tem um perfil otimista. Os Consultores preferem lidar com os outros com base em amizades de longa data. Bons ouvintes, com tendência a ouvir problemas dos outros, eles dão sugestões de forma amorosa e são reticentes em impor suas ideias aos outros.Consultores tendem a ser indulgentes demais e pacientes com os que não produzem. Sob pressão podem ter dificuldade ao se confrontar com problemas de performance diretamente. Consultores podem ser indiretos em demasia ao dar ordens, fazer exigências ou a punir outros. com a atitude do tipo  as pessoas são importantes ,  os Consultores põem menos ênfase no cumprimento de tarefas. Eles muitas vezes necessitam de ajuda ao estabelecer e cumprir as reais prazos finais.Consultores com frequencia tomam críticas como uma afronta pessoal, mas reagem bem a atenção e elogios por serviços bem feitos. Quando em posições de respnsabilidade, Consultores tendem a dar bastante atenção às condições de trabalho e por dar adequado reconhecimento aos membros do grupo."
  });

      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 2755, "aumentaria" : "Autêntica colaboração pelo bem comum, delegar tarefas chave às pessoas competentesProfissionais Liberais valorizam a proficiência em áreas especializadas. Impulsionado pelo desejo de ser  bom em algo , eles monitoram suas próprias performances profissionais. Ainda que o objetivo seja ser  o  especialista na área, Profissionais Liberais dão a impressão de que sabem algo de muitas coisas. Essa imagem é especialmente forte quando eles verbalizam o conhecimento que possuem sobre vários temas.Como Profissionais Liberais interagem com outros, frequentemente externam um estilo de estar à vontade, diplomático e de bem com a vida. Essa atitude simpática pode mudar rapidamente no ambiente de trabalho quando eles ficam concentrados em atingir altos padrões de desempenho. Valorizando a autodisciplina, Profissionais Liberais avaliam os outros pela sua autodisciplina medida no desempenho do dia a dia. Eles tem altas expectativas deles mesmos e de outros e tendem a verbalizar sua decepção.Ao mesmo tempo em que tendem a se concentrar no desenvolvimento de uma abordagem organizada para o trabalho e aumentar suas habilidades, os Profissionais Liberais também precisam ajudar os outros a desenvolver habilidades. Além disso, eles precisam aumentar seu reconhecimento àqueles que se esforçam em trabalhar ainda que eles possam não se utilizar o que os Profissionais Liberais chamam de  jeito certo ."
  });

