      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 3141, "aumentaria" : "Antes de ir adiante, revise a pontuação de seu grafico de perfil pela possibilidade de erros feitos ao computar suas respostas ou ao colocar no diagrama sua pontuação. Um Padrão Turno-extra ocorre quando os todos os quatro pontos no diagrama ficam posicionados na parte superior do grafico. Isso indica que a pessoa considerou todos os quatro estilos de comportamento sendo de importancia igualmente alta. Como resultado, a forma do perfil não se encaixa em nenhum dos Perfis de Padrão Clássico mais comuns.Os Padrões Clássicos representam combinações de pontuação alta e baixa no diagrama e o Padrão Turno-extra tem somente pontos no alto do diagrama. Quando um Turno-extra ocorre no Gráfico III, é recomendável que one dos outros dois gráficos seja usado para interpretação, lembrando que Gráfico I ou Gráfico II representa apenas metada das respostas. Retomar o Perfil com um foco mais claro pode ajudar."
  });

