      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 3215, "aumentaria" : "Revelar-se aos outros, dividir com os outros seus pensamentos e opiniõesPensadores Objetivos tendem a ter habilidade de pensamento altamente desenvolvido para a crítica. Eles enfatizam a importância de tirar conclusões baseando ações em fatos, buscando a precisão e a exatidão em tudo que fazem. No entanto, para gerir suas atividades laborais eficientemente, Pensadores Objetivos a miúde combinam informação intuitiva com fatos que eles reuniram. Quando têm dúvida sobre algum modo de ação, eles evitam fazer-se de tolos através de uma preparação meticulosa. Por exemplo, Pensadores Objetivos irão dominar completamente uma habilidade sozinhos antes de usa-la em trabalho em grupo.Pensadores Objetivos preferem trabalhar com pessoas que, como eles, estejam interessadas em manter um ambiente de trabalho tranquilo. Considerados tímidos por alguns, eles podem ser reticentes em expressar seus sentimentos. Particularmente, eles ficam desconfortáveis com pessoas agressivas. Apesar dessa aparência lenitiva, Pensadores Objetivos têm uma necessidade de controlar seu ambiente. Eles tendem a externar esse controle indiretamente por meio de requererem adesão a regras e padrões.Pensadores Objetivos estão preocupados com a resposta  certa  e podem ter problemas ao tomar decisões em situações ambíguas. Tendo tendências à preocupação, eles podem ficar atolados em  analysis paralysis  (análise paralítica*). Muito frequentemente quando comentem um erro, Pensadores Objetivos hesitam em reconhecê-lo. Ao invés disso, eles mergulham em pesquisar informações que ainda possa embasar seu posicionamento."
  });

