      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 3561, "aumentaria" : "Os Agentes estão atentos tanto ao aspecto humano quanto aos aspectos da tarefa numa situação de trabalho. Com empatia e apoio, eles são bons ouvidores e são conhecidos por seus ouvidos condescendentes. Agentes também fazem com as pessoas se sintam bem quistas e necessárias por causa de sua sensibilidade às necessidades dos outros. As pessoas têm pouco medo de serem rejeitadas por Agentes. Além disso, Agentes oferecem amizade e são sensíveis a fazerem serviços pelos outros.Referente ao aspecto de tarefa do trabalho, os Agentes têm um excelente potencial para organizar um trabalho e leva-lo ao término eficientemente. Agentes são particularmente bons em fazer trabalhos para os outros que eles acham difíceis de fazer por eles mesmos. Agentes normalmente promovem a harmonia e o trabalho em grupo.No entanto, os Agentes realmente temem o conflito e a discórdia. Sua abordagem de apoio pode fazer com que os outros tolerem uma situação mais do que se comprometam a solucionar ativamente um problema. Ademais, a tendência de os Agentes não chamarem a atenção ao invés de dar-se a confrontos abertamente com pessoas agressivas, pode ser interpretada como falta de tenacidade. Ainda assim, Agentes têm um preciso grau de independência ainda que estejam preocupados em como podem encaixar-se no grupo."
  });

