      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 3645, "aumentaria" : "Autêntica colaboração pelo bem comum, delegar tarefas chave às pessoas competentesProfissionais Liberais valorizam a proficiência em áreas especializadas. Impulsionado pelo desejo de ser  bom em algo , eles monitoram suas próprias performances profissionais. Ainda que o objetivo seja ser  o  especialista na área, Profissionais Liberais dão a impressão de que sabem algo de muitas coisas. Essa imagem é especialmente forte quando eles verbalizam o conhecimento que possuem sobre vários temas.Como Profissionais Liberais interagem com outros, frequentemente externam um estilo de estar à vontade, diplomático e de bem com a vida. Essa atitude simpática pode mudar rapidamente no ambiente de trabalho quando eles ficam concentrados em atingir altos padrões de desempenho. Valorizando a autodisciplina, Profissionais Liberais avaliam os outros pela sua autodisciplina medida no desempenho do dia a dia. Eles tem altas expectativas deles mesmos e de outros e tendem a verbalizar sua decepção.Ao mesmo tempo em que tendem a se concentrar no desenvolvimento de uma abordagem organizada para o trabalho e aumentar suas habilidades, os Profissionais Liberais também precisam ajudar os outros a desenvolver habilidades. Além disso, eles precisam aumentar seu reconhecimento àqueles que se esforçam em trabalhar ainda que eles possam não se utilizar o que os Profissionais Liberais chamam de  jeito certo ."
  });

