      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 4151, "aumentaria" : "Divisão de suas ideias, autoconfiança baseada em retroinformação, métodos de atalhoEspecialistas  conservam-se bem  com os outros. Com seu comportamento moderado, controlado, modesto e com compostura, eles estão aptos a trabalhar bem com diversos estilos de comportamento. Especialistas são ponderados, pacientes, e sempre dispostos a ajudar aqueles que consideram amigos. De veras, eles tendem ter relacionamentos íntimos com um grupo relativamente pequeno de pessoas do ambiente de trabalho.Seus esforços são dirigidos a padrões familiares e previsíveis. Muito eficazes nas áreas especializadas em esforço, Especialistas planejam seus trabalhos junto a canais dirigidos e realizar uma atuação com consistência extraordinária. A gratidão dos outros ajuda a manter esse nível.Especialistas são lentos para se adaptar a mudanças. Antes que o condicionamento dê a eles tempo de mudar seu comportamento e ainda manter um nível consistente de atuação. Especialistas podem também pedir ajuda para começar novos projetos e em desenvolver métodos de atalhos para chegar ao final. Projetos terminados são com frequencia postos de lado para finaização posterior. Um aviso: jogue fora alguns daqueles panfletos no armário."
  });

