      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 4541, "aumentaria" : "Atenção às prazos finais, iniciativa de fazer a tarefaConsultores são particularmente bons em resolver problemas pessoais. Impressionam os demais com sua maneira amável, empatia e compreensão. Acham fácil olhar o que de bom existe nos outros e tem um perfil otimista. Os Consultores preferem lidar com os outros com base em amizades de longa data. Bons ouvintes, com tendência a ouvir problemas dos outros, eles dão sugestões de forma amorosa e são reticentes em impor suas ideias aos outros.Consultores tendem a ser indulgentes demais e pacientes com os que não produzem. Sob pressão podem ter dificuldade ao se confrontar com problemas de performance diretamente. Consultores podem ser indiretos em demasia ao dar ordens, fazer exigências ou a punir outros. com a atitude do tipo  as pessoas são importantes ,  os Consultores põem menos ênfase no cumprimento de tarefas. Eles muitas vezes necessitam de ajuda ao estabelecer e cumprir as reais prazos finais.Consultores com frequencia tomam críticas como uma afronta pessoal, mas reagem bem a atenção e elogios por serviços bem feitos. Quando em posições de respnsabilidade, Consultores tendem a dar bastante atenção às condições de trabalho e por dar adequado reconhecimento aos membros do grupo."
  });

