      "codigo" : 4555, "aumentaria" : "Antes de ir adiante, revise a pontuação de seu grafico de perfil pela possibilidade de erros feitos ao computar suas respostas ou ao colocar no diagrama sua pontuação. Um Padrão Turno-extra ocorre quando os todos os quatro pontos no diagrama ficam posicionados na parte superior do grafico. Isso indica que a pessoa considerou todos os quatro estilos de comportamento sendo de importancia igualmente alta. Como resultado, a forma do perfil não se encaixa em nenhum dos Perfis de Padrão Clássico mais comuns.Os Padrões Clássicos representam combinações de pontuação alta e baixa no diagrama e o Padrão Turno-extra tem somente pontos no alto do diagrama. Quando um Turno-extra ocorre no Gráfico III, é recomendável que one dos outros dois gráficos seja usado para interpretação, lembrando que Gráfico I ou Gráfico II representa apenas metada das respostas. Retomar o Perfil com um foco mais claro pode ajudar."
  });

      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 4556, "aumentaria" : "Autêntica colaboração pelo bem comum, delegar tarefas chave às pessoas competentesProfissionais Liberais valorizam a proficiência em áreas especializadas. Impulsionado pelo desejo de ser  bom em algo , eles monitoram suas próprias performances profissionais. Ainda que o objetivo seja ser  o  especialista na área, Profissionais Liberais dão a impressão de que sabem algo de muitas coisas. Essa imagem é especialmente forte quando eles verbalizam o conhecimento que possuem sobre vários temas.Como Profissionais Liberais interagem com outros, frequentemente externam um estilo de estar à vontade, diplomático e de bem com a vida. Essa atitude simpática pode mudar rapidamente no ambiente de trabalho quando eles ficam concentrados em atingir altos padrões de desempenho. Valorizando a autodisciplina, Profissionais Liberais avaliam os outros pela sua autodisciplina medida no desempenho do dia a dia. Eles tem altas expectativas deles mesmos e de outros e tendem a verbalizar sua decepção.Ao mesmo tempo em que tendem a se concentrar no desenvolvimento de uma abordagem organizada para o trabalho e aumentar suas habilidades, os Profissionais Liberais também precisam ajudar os outros a desenvolver habilidades. Além disso, eles precisam aumentar seu reconhecimento àqueles que se esforçam em trabalhar ainda que eles possam não se utilizar o que os Profissionais Liberais chamam de  jeito certo ."
  });

