      "codigo" : 4737, "aumentaria" : "Finalização individual, empatia ao demonstrar desaprovação,  acompanhar os outros Avaliadores têm idéias criativas e fazem com que elas sirvam a um propósito prático. São competitivos e usam métodos diretos para atingir resultados. Entretanto, há os que tendem a ver os Avaliadores mais como assertivos do que como agressivos por causa de sua demonstração de consideração. Ao invés de dar ordens ou comandos, os Avaliadores comprometem pessoas nas tarefas utilizando métodos persuasivos. Eles induzem os que o cercam a cooperar por explicar a análise racional ou atividades propostas. Avaliadores tendem a ter a habilidade de ajudar os outros a visualizar os passos necessários para atingir seus resultados. Eles normalmente estão falando de um plano detalhado de ação que desenvolveram para ter certeza do progresso ordenado em direção aos resultados. No entanto, na ansiedade de vencer, os Avaliadores podem ficar impacientes quando seus padrões não forem mantidos ou quando uma finalização mais extensa for necessária.Avaliadores são bons críticos e podem ser verborrágicos ao expressar suas críticas. Suas palavras podem ser dolorosas como uma picada. Avaliadores podem ter controle melhor de problemas se ficarem tranquilos e andarem em seus ritmos. Há um axioma útil para isto:  algo você ganha e algo você perde ."
  });

      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 4741, "aumentaria" : "Controle do tempo, objetividade, senso de urgência, controle emocional, acompanhamento do que prometeu, das tarefasOs Patrocinadores têm uma extensa lista de contatos que possibilita uma base ativa para fazer negócios. Gregário e socialmente experiente, eles fazem amizades facilmente. Raramente hostilizam alguém intencionalmente. Patrocinadores buscam ambientes sociais favoráveis onde eles possam continuar a fazer e manter seus contatos. Com habilidades de oratória, são bons em promover suas próprias ideias e em criar o entusiasmo  pelos projetos de outros. Com seu grande leque de contatos, Patrocinadores têm acesso às pessoas certas que têm a capacidade de ajudar.Uma vez que Patrocinadores preferem interagir com outros e participar de atividades envolvendo pessoas, eles podem estar menos interessados em terminar as tarefas. Podem continuar buscar qualquer situação envolvendo encontro e socialização com pessoas ainda que seu trabalho exija atenção a atividades mais individuais. Eles têm sucesso em reuniões, convenções e conferências. Normalmente otimistas Patrocinadores tendem a superestimar as habilidades dos outros. Frequentemente se precipitam a conclusões favoráveis sem considerar todos os fatos. Treinamento e orientação ajudam Patrocinadores desenvolver objetividade e ênfase nos resultados. Planejamento e controle do tempo podem apresentar desafios para os Patrocinadores. Ao estabelecerem um limite de tempo em conversas, eles podem lembrar-se da urgência de  terminar  e cumprir a tarefa."
  });

