      "codigo" : 5167, "aumentaria" : "Flexibilidade, aceitar as outras pessoas, envolvimento pessoal com os outrosObjetivos e analíticos, Investigadores são desapaixonadas  ancoras da realidade . Geralmente tímidos, eles calmamente percorrem um caminho independente em direção a um objetivo determinado. Investigadores são bem sucedidos em muitas coisas, não por causa da versatilidade, mas por causa de uma determinação obstinada de seguirem a diante. Eles perseguem um propósito ou objetivo claro para os quais eles podem desenvolver, planejar e organizar suas ações. Uma vez dentro de um projeto, os Investigadores lutam tenazmente para atingir seus objetivos. A intervenção às vezes é necessária para mudar sua direção. Como resultado, eles podem ser considerados obstinados e teimosos .Investigadores se dão bem com trabalhos desafiadores de natureza técnica, nos quais eles podem usar dados reais, interpretar a informação e chegar a conclusões. Eles reagem melhor ao racional do que ao emocional. Ao venderem ou transacionarem uma ideia, podem ser bem sucedidos se tiverem um produto concreto.Preferindo trabalhar sozinhos, Investigadores não estão especialmente interessados em agradar as pessoas. Eles podem ser considerados friamente rudes e sem tato. Valorizando sua habilidade de pensar, Investigadores avaliam os outros com base em seu uso factual e da racionalidade. Para aumentar a sua eficácia no relacionamento com as pessoas, eles precisam desenvolver uma grande compreensão das outras pessoas, incluindo suas emoções."
  });

      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 5171, "aumentaria" : "redução de pensamentos   ou – ou , ter claro a prioridade da tarefa e as abordagens opcionais, desejo de se comprometer com os benefícios de longa duração em curto prazoA motivação dos Empreendedores é basicamente interna e vem de objetivos profundamente pessoais. Esse prévio comprometimento com seus objetivos impede que aceitem os objetivos do grupo. Empreendedores precisam ver como podem mesclar seus objetivos com os da empresa. Mantendo o controle sobre o principal caminho de suas vidas, os Empreendedores desenvolveram um forte senso de responsabilidade.Os Empreendedores demonstram um entusiástico interesse em seu trabalho e um intenso e contínuo empenho por realizações. Eles têm uma elevada opinião sobre seu trabalho e frequentemente fazem o trabalho eles mesmos, pois assim têm certeza de que o trabalho foi feito corretamente. Valorizam o trabalho duro e, sob pressão, podem tornar-se  quem faz  ao invés de  delegar . Quando delegam mesmo, têm a tendência de tomar o trabalho de volta se não estiver sendo feito conforme lhes satisfaça. Sua premissa diretiva:  se eu for bem sucedido, o mérito é meu, mas se eu falhar, eu sou culpado .Comunicar-se mais com os outros ajudaria o Empreendedor evitar pensar   tenho que fazer eu mesmo  ou  quero todo o mérito . Eles podem precisar de ajuda considerando outras abordagens para realizar os resultados que eles desejam. Empreendedores sabem que eles funcionam no máximo da eficiência e eles esperam reconhecimento à altura de sua contribuição no alto lucro de empresas, cargos em outros grupos de liderança."
  });

