      "codigo" : 6134, "aumentaria" : "paciência, empatia, participação e a colaboração com os outros, executar o projeto e atenção com o controle da qualidadePlanejadores tendem a ser fortemente individualistas que continuamente buscam novos horizontes. Extremamente seguro de si mesmo e independente quanto ao pensamento e ações, eles preferem encontrar suas próprias soluções.Enquanto que eles principalmente preferem ter um comportamento direto e impetuoso, Planejadores são capazes também de astutamente manipular pessoas e situações. No entanto, quando solicitados a participar  com outros em situações  que limitam seu individualismo, os Planejadores se tornam belicosos. Eles são muito persistentes em perseguir os resultados que eles desejam, fazendo tudo que for necessário para ultrapassar qualquer obstáculo que possa aparecer. Além disso, eles colocam altas expectativas nos outros e podem ser muito críticos quando seus modelos não são seguidos.Planejadores são muito interessados em conseguir seus objetivos, oportunidades para avançar e desafios são importantes para eles. Sendo tão focados em resultados, frequentemente podem deixar de ter empatia e parecer descuidados. Eles podem dizer assim:  Tome uma aspirina. Eu já passei por isso também  ou  Não chore como criança.  Você vai ficar bem! ."
  });

      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 6135, "aumentaria" : "Cordialidade, comunicação polida, cooperação efetiva da equipe, reconhecimento de que penalidades existemPessoas com o Padrão Criativo refletem duas forças opostas em seu comportamento. Desejo por resultados tangíveis é contrabalanceado por um desejo igualmente forte por querer a perfeição. A agressividade é arrefecida pela sensibilidade. Rapidez no pensamento e em respostas é controlada pelo desejo de explorar todas as soluções possíveis antes da decisão.Criativos mostram visão ao focar em projetos e eles realmente realizam. Já que pessoas com o Padrão Criativo tem vocação para o perfeccionismo e consideravel habilidade para o planejamento, as mudanças que eles fazem são provavelmente perfeitas, embora os métodos usados podem ser desprovidos de atenção ao relacionamento interpessoal.Pessoas criativas querem liberdade para explorar e autoridade para examinar e retestar descobertas. Elas podem tomar decisões diárias rapidamente mas podem ser extremamente cautelosas ao tomar decisões mais importantes:  Devo dar aquela promoção?   Devo fazer aquela mudança de local? . Em sua busca por resultados e perfeição, pessoas Criativas podem não estar preocupadas com a estabilidade social. Eles podem ressaltar a fria indiferença e rispidez."
  });

