      "codigo" : 6422, "aumentaria" : "Externar o que racionalizam, buscar outras ideias e pontos de vista sobre os objetivos ao solucionar problemas, preocupação verdadeira com os outros, paciência e humildadePessoas que se Orientam por resultados demonstram uma autoconfiança que alguns podem interpretar como arrogância. Eles ativamente buscam oportunidades que testam e desenvolvem suas habilidades para conseguir resultados. Pessoas que se Orientam por resultados gostam de tarefas difíceis, situações de competitividade, designações peculiares e cargos  importantes . Elas tomam responsabilidades com ares de  Eu vou fazer  e quando terminam,  Eu te disse que podia .Pessoas que se Orientam por resultados tendem a evitar fatores limitantes tais como controle de orientações, detalhes do uso do tempo e trabalho rotineiro. Firmes e diretos, elas podem ter dificuldades com os outros. Prezando sua independência, elas podem ficar exaustas quando envolvidas em trabalho em equipe ou em trabalhos em comissão. Ainda que Pessoas que se Orientam por resultados geralmente prefiram trabalhar sozinhas, elas podem persuadir outros a dar apoio a seus esforços especialmente para completar atividades rotineiras. Pessoas que se Orientam por resultados são rápidas em pensamentos e ações. São impacientes e buscam falhas nos que não são assim, avaliando os outros em sua habilidades de obter resultados. São determinados e persistentes, mesmo ao depararem com conflitos. Pessoas que se Orientam por resultados tomam a liderança da situação se acharem que é necessário, se estiverem no comando ou não. Em seu modo de direção descompromissado pelos resultados, eles podem parecer rudes e descuidados."
  });

