      "codigo" : 6444, "aumentaria" : "Externar o que racionalizam, buscar outras ideias e pontos de vista sobre os objetivos ao solucionar problemas, preocupação verdadeira com os outros, paciência e humildadePessoas que se Orientam por resultados demonstram uma autoconfiança que alguns podem interpretar como arrogância. Eles ativamente buscam oportunidades que testam e desenvolvem suas habilidades para conseguir resultados. Pessoas que se Orientam por resultados gostam de tarefas difíceis, situações de competitividade, designações peculiares e cargos  importantes . Elas tomam responsabilidades com ares de  Eu vou fazer  e quando terminam,  Eu te disse que podia .Pessoas que se Orientam por resultados tendem a evitar fatores limitantes tais como controle de orientações, detalhes do uso do tempo e trabalho rotineiro. Firmes e diretos, elas podem ter dificuldades com os outros. Prezando sua independência, elas podem ficar exaustas quando envolvidas em trabalho em equipe ou em trabalhos em comissão. Ainda que Pessoas que se Orientam por resultados geralmente prefiram trabalhar sozinhas, elas podem persuadir outros a dar apoio a seus esforços especialmente para completar atividades rotineiras. Pessoas que se Orientam por resultados são rápidas em pensamentos e ações. São impacientes e buscam falhas nos que não são assim, avaliando os outros em sua habilidades de obter resultados. São determinados e persistentes, mesmo ao depararem com conflitos. Pessoas que se Orientam por resultados tomam a liderança da situação se acharem que é necessário, se estiverem no comando ou não. Em seu modo de direção descompromissado pelos resultados, eles podem parecer rudes e descuidados."
  });

      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 6445, "aumentaria" : "Cordialidade, comunicação polida, cooperação efetiva da equipe, reconhecimento de que penalidades existemPessoas com o Padrão Criativo refletem duas forças opostas em seu comportamento. Desejo por resultados tangíveis é contrabalanceado por um desejo igualmente forte por querer a perfeição. A agressividade é arrefecida pela sensibilidade. Rapidez no pensamento e em respostas é controlada pelo desejo de explorar todas as soluções possíveis antes da decisão.Criativos mostram visão ao focar em projetos e eles realmente realizam. Já que pessoas com o Padrão Criativo tem vocação para o perfeccionismo e consideravel habilidade para o planejamento, as mudanças que eles fazem são provavelmente perfeitas, embora os métodos usados podem ser desprovidos de atenção ao relacionamento interpessoal.Pessoas criativas querem liberdade para explorar e autoridade para examinar e retestar descobertas. Elas podem tomar decisões diárias rapidamente mas podem ser extremamente cautelosas ao tomar decisões mais importantes:  Devo dar aquela promoção?   Devo fazer aquela mudança de local? . Em sua busca por resultados e perfeição, pessoas Criativas podem não estar preocupadas com a estabilidade social. Eles podem ressaltar a fria indiferença e rispidez."
  });

