      "codigo" : 6727, "aumentaria" : "Finalização individual, empatia ao demonstrar desaprovação,  acompanhar os outros Avaliadores têm idéias criativas e fazem com que elas sirvam a um propósito prático. São competitivos e usam métodos diretos para atingir resultados. Entretanto, há os que tendem a ver os Avaliadores mais como assertivos do que como agressivos por causa de sua demonstração de consideração. Ao invés de dar ordens ou comandos, os Avaliadores comprometem pessoas nas tarefas utilizando métodos persuasivos. Eles induzem os que o cercam a cooperar por explicar a análise racional ou atividades propostas. Avaliadores tendem a ter a habilidade de ajudar os outros a visualizar os passos necessários para atingir seus resultados. Eles normalmente estão falando de um plano detalhado de ação que desenvolveram para ter certeza do progresso ordenado em direção aos resultados. No entanto, na ansiedade de vencer, os Avaliadores podem ficar impacientes quando seus padrões não forem mantidos ou quando uma finalização mais extensa for necessária.Avaliadores são bons críticos e podem ser verborrágicos ao expressar suas críticas. Suas palavras podem ser dolorosas como uma picada. Avaliadores podem ter controle melhor de problemas se ficarem tranquilos e andarem em seus ritmos. Há um axioma útil para isto:  algo você ganha e algo você perde ."
  });

      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 6731, "aumentaria" : "sensibilidade autêntica, boa vontade em ajudar os outros a serem bem sucedidos em seu próprio negócioPessoas no padrão Inspirador conscientemente tentam modificar os pensamentos e as ações das outras pessoas. Procurando controlar seu ambiente, eles são astutos em identificar e manipular os motivos das outras pessoas e direcionar o comportamento resultante rumo a um fim pré-determinado.Pessoas inspiradoras deixam claro os resultados que querem, mas eles nem sempre os dizem imediatamente. Eles falam primeiro os resultados que eles querem somente depois de terem preparado o terreno para a outra pessoa. Por exemplo, pessoas inspiradoras oferecem amizade aos interessados em ser aceitos, mais autoridade àqueles que procuram poder, e segurança aos que procuram um ambiente previsível.Pessoas inspiradoras podem ser encantadoras no contato com outras. São persuasivas para obter ajuda através de detalhes repetitivos e que absorvem tempo. Entretanto, as pessoas com frequência têm a sensação conflitante de serem atraídos por eles e ao mesmo tempo sentirem que estão curiosamente à distância. Outros terão o sentimento de estarem sendo  usados . Enquanto que eles às vezes podem inspirar medo em outros e atropelar suas decisões, pessoas Inspiradoras são consideradas geralmente benquistas por colaboradores. Isto resulta do uso de suas habilidades verbais consideráveis para persuadir outros sempre que isso for possível. Pessoas inspiradoras preferem claramente realizar seus objetivos através do trabalho com os outros mais do que por dominá-los."
  });

