      "codigo" : 7241, "aumentaria" : "paciência, empatia, participação e a colaboração com os outros, executar o projeto e atenção com o controle da qualidadePlanejadores tendem a ser fortemente individualistas que continuamente buscam novos horizontes. Extremamente seguro de si mesmo e independente quanto ao pensamento e ações, eles preferem encontrar suas próprias soluções.Enquanto que eles principalmente preferem ter um comportamento direto e impetuoso, Planejadores são capazes também de astutamente manipular pessoas e situações. No entanto, quando solicitados a participar  com outros em situações  que limitam seu individualismo, os Planejadores se tornam belicosos. Eles são muito persistentes em perseguir os resultados que eles desejam, fazendo tudo que for necessário para ultrapassar qualquer obstáculo que possa aparecer. Além disso, eles colocam altas expectativas nos outros e podem ser muito críticos quando seus modelos não são seguidos.Planejadores são muito interessados em conseguir seus objetivos, oportunidades para avançar e desafios são importantes para eles. Sendo tão focados em resultados, frequentemente podem deixar de ter empatia e parecer descuidados. Eles podem dizer assim:  Tome uma aspirina. Eu já passei por isso também  ou  Não chore como criança.  Você vai ficar bem! ."
  });

