      "codigo" : 7264, "aumentaria" : "redução de pensamentos   ou – ou , ter claro a prioridade da tarefa e as abordagens opcionais, desejo de se comprometer com os benefícios de longa duração em curto prazoA motivação dos Empreendedores é basicamente interna e vem de objetivos profundamente pessoais. Esse prévio comprometimento com seus objetivos impede que aceitem os objetivos do grupo. Empreendedores precisam ver como podem mesclar seus objetivos com os da empresa. Mantendo o controle sobre o principal caminho de suas vidas, os Empreendedores desenvolveram um forte senso de responsabilidade.Os Empreendedores demonstram um entusiástico interesse em seu trabalho e um intenso e contínuo empenho por realizações. Eles têm uma elevada opinião sobre seu trabalho e frequentemente fazem o trabalho eles mesmos, pois assim têm certeza de que o trabalho foi feito corretamente. Valorizam o trabalho duro e, sob pressão, podem tornar-se  quem faz  ao invés de  delegar . Quando delegam mesmo, têm a tendência de tomar o trabalho de volta se não estiver sendo feito conforme lhes satisfaça. Sua premissa diretiva:  se eu for bem sucedido, o mérito é meu, mas se eu falhar, eu sou culpado .Comunicar-se mais com os outros ajudaria o Empreendedor evitar pensar   tenho que fazer eu mesmo  ou  quero todo o mérito . Eles podem precisar de ajuda considerando outras abordagens para realizar os resultados que eles desejam. Empreendedores sabem que eles funcionam no máximo da eficiência e eles esperam reconhecimento à altura de sua contribuição no alto lucro de empresas, cargos em outros grupos de liderança."
