      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 7355, "aumentaria" : "Flexibilidade, aceitar as outras pessoas, envolvimento pessoal com os outrosObjetivos e analíticos, Investigadores são desapaixonadas  ancoras da realidade . Geralmente tímidos, eles calmamente percorrem um caminho independente em direção a um objetivo determinado. Investigadores são bem sucedidos em muitas coisas, não por causa da versatilidade, mas por causa de uma determinação obstinada de seguirem a diante. Eles perseguem um propósito ou objetivo claro para os quais eles podem desenvolver, planejar e organizar suas ações. Uma vez dentro de um projeto, os Investigadores lutam tenazmente para atingir seus objetivos. A intervenção às vezes é necessária para mudar sua direção. Como resultado, eles podem ser considerados obstinados e teimosos .Investigadores se dão bem com trabalhos desafiadores de natureza técnica, nos quais eles podem usar dados reais, interpretar a informação e chegar a conclusões. Eles reagem melhor ao racional do que ao emocional. Ao venderem ou transacionarem uma ideia, podem ser bem sucedidos se tiverem um produto concreto.Preferindo trabalhar sozinhos, Investigadores não estão especialmente interessados em agradar as pessoas. Eles podem ser considerados friamente rudes e sem tato. Valorizando sua habilidade de pensar, Investigadores avaliam os outros com base em seu uso factual e da racionalidade. Para aumentar a sua eficácia no relacionamento com as pessoas, eles precisam desenvolver uma grande compreensão das outras pessoas, incluindo suas emoções."
  });

