      "codigo" : 7646, "aumentaria" : "Cordialidade, comunicação polida, cooperação efetiva da equipe, reconhecimento de que penalidades existemPessoas com o Padrão Criativo refletem duas forças opostas em seu comportamento. Desejo por resultados tangíveis é contrabalanceado por um desejo igualmente forte por querer a perfeição. A agressividade é arrefecida pela sensibilidade. Rapidez no pensamento e em respostas é controlada pelo desejo de explorar todas as soluções possíveis antes da decisão.Criativos mostram visão ao focar em projetos e eles realmente realizam. Já que pessoas com o Padrão Criativo tem vocação para o perfeccionismo e consideravel habilidade para o planejamento, as mudanças que eles fazem são provavelmente perfeitas, embora os métodos usados podem ser desprovidos de atenção ao relacionamento interpessoal.Pessoas criativas querem liberdade para explorar e autoridade para examinar e retestar descobertas. Elas podem tomar decisões diárias rapidamente mas podem ser extremamente cautelosas ao tomar decisões mais importantes:  Devo dar aquela promoção?   Devo fazer aquela mudança de local? . Em sua busca por resultados e perfeição, pessoas Criativas podem não estar preocupadas com a estabilidade social. Eles podem ressaltar a fria indiferença e rispidez."
  });

