      db.collection("Disc").document("tabelas").collection("Aumentaria").add({
      "codigo" : 7651, "aumentaria" : "sensibilidade autêntica, boa vontade em ajudar os outros a serem bem sucedidos em seu próprio negócioPessoas no padrão Inspirador conscientemente tentam modificar os pensamentos e as ações das outras pessoas. Procurando controlar seu ambiente, eles são astutos em identificar e manipular os motivos das outras pessoas e direcionar o comportamento resultante rumo a um fim pré-determinado.Pessoas inspiradoras deixam claro os resultados que querem, mas eles nem sempre os dizem imediatamente. Eles falam primeiro os resultados que eles querem somente depois de terem preparado o terreno para a outra pessoa. Por exemplo, pessoas inspiradoras oferecem amizade aos interessados em ser aceitos, mais autoridade àqueles que procuram poder, e segurança aos que procuram um ambiente previsível.Pessoas inspiradoras podem ser encantadoras no contato com outras. São persuasivas para obter ajuda através de detalhes repetitivos e que absorvem tempo. Entretanto, as pessoas com frequência têm a sensação conflitante de serem atraídos por eles e ao mesmo tempo sentirem que estão curiosamente à distância. Outros terão o sentimento de estarem sendo  usados . Enquanto que eles às vezes podem inspirar medo em outros e atropelar suas decisões, pessoas Inspiradoras são consideradas geralmente benquistas por colaboradores. Isto resulta do uso de suas habilidades verbais consideráveis para persuadir outros sempre que isso for possível. Pessoas inspiradoras preferem claramente realizar seus objetivos através do trabalho com os outros mais do que por dominá-los."
  });

